Compound:
Бальзам бережно увлажняет и питает губы, помогая им оставаться ухоженными и мягкими в течение дня. Всё дело – в особом рецепте:

масло сладкого миндаля избавляет от сухости и шелушений;
кокосовое масло возвращает гладкость и упругость;
касторовое масло успокаивает и смягчает;
масло жожоба предотвращает появление трещинок;
канделильский воск защищает от обветривания.
